jednak pristup znanju, kulturi i informacijama, podstičući čitanje, obrazovanje i stvaralaštvo. Kao čuvar pisane reči i kulturne baštine, biblioteka nastoji da razvija čitalačke navike, neguje ljubav prema knjizi i doprinosi intelektualnom i duhovnom razvoju zajednice.',NULL),(14995,1,'aboutus','goal','sr-Cyrl','Библиотека тежи да буде савремен и отворен културни центар који прати потребе савременог читаоца, примењује нове технологије и подстиче културу учења током целог живота. Циљ је да библиотека постане место сусрета, дијалога и сарадње — простор у којем се спајају традиција и модерност, знање и креативност.',NULL),(14996,1,'aboutus','goal','sr','Biblioteka teži da bude savremen i otvoren kulturni centar koji prati potrebe savremenog čitaoca, primenjuje nove tehnologije i podstiče kulturu učenja tokom celog života. Cilj je da biblioteka postane mesto susreta, dijaloga i saradnje — prostor u kojem se spajaju tradicija i modernost, znanje i kreativnost.',NULL),(16328,58,'document','title','sr','Pravilnik za javne nabavke','Pravilnik za javne nabavke - Naslov'),(16329,58,'document','description','sr','Akt koji reguliše procedure javnih nabavki.','Pravilnik za javne nabavke - Opis'),(16330,58,'document','title','sr-cyrl','Правилник за јавне набавке','Правилник за јавне набавке - Наслов'),(16331,58,'document','description','sr-cyrl','Акт који регулише процедуре јавних набавки.','Правилник за јавне набавке - Опис'),(16332,59,'document','title','sr','Izveštaj o realizaciji poslovanja za 2024.','Izveštaj o poslovanju 2024 - Naslov'),(16333,59,'document','description','sr','Godišnji izveštaj o ostvarenom poslovanju za 2024. godinu.','Izveštaj o poslovanju 2024 - Opis'),(16334,59,'document','title','sr-cyrl','Извештај о реализацији пословања за 2024.','Извештај о пословању 2024 - Наслов'),(16335,59,'document','description','sr-cyrl','Годишњи извештај о оствареном пословању за 2024. годину.','Извештај о пословању 2024 - Опис'),(16336,60,'document','title','sr','Pravilnik z