ada za rad “Vesela azbuka”, drugu nagradu je osvojio likovni umetnik iz Novog Sada Nedeljko Marković za rad “Olovka piše srcem” a treću nagradu dobila je Metka Pepelnak iz Slovenije za rad pod nazivom “Ljudski trag”.\r\nU Kulturnom centru Zrenjanina Likovni salon “30X30” biće otvoren do 6. januara 2025. a nakon toga gostovaće u Beogradu, Pančevu, Sremskoj Mitrovici, Novom Sadu i Požegi.',NULL),(16977,67,'generic_element','opis','sr-Cyrl','У Културном центру Зрењанина отворен је 19. Ликовни салон “30X30”. У оквиру салона представљају се радови најуспешнијих учесника овогодишњег истоименог ликовног конкурса (“30X30”) који је почетком септембра расписао Културни центар Зрењанина у сарадњи са аутором пројекта мр Милутином Мићићем.\r\nНа Ликовни конкурс “30×30” ове године пријавило се 185 аутора из Србије, БиХ, Републике Српске, Црне Горе, Македоније и Словеније, Турске, Шпаније и Белорусије.\r\nЖири у саставу: Ана Станар, историчарка уметности, мр Вукашин Миловић, вајар и мр Милутин Мићић, академски сликар и аутор пројекта одабрао је 19. 11. 2024. године, радове 126 аутора за излагање и доделио три награде. Добитница прве награде је Јулијана Протић из Београда за рад “Весела азбука”, другу награду је освојио ликовни уметник из Новог Сада Недељко Марковић за рад “Оловка пише срцем” а трећу награду добила је Метка Пепелнак из Словеније за рад под називом “Људски траг”.\r\nУ Културном центру Зрењанина Ликовни салон “30X30” биће отворен до 6. јануара 2025. а након тога гостоваће у Београду, Панчеву, Сремској Митровици, Новом Саду и Пожеги.',NULL),(16978,68,'generic_element','naslov','sr','Gradski dečji hor KCZR-a nagrađen Zlatnom plaketom',NULL),(16979,68,'generic_element','naslov','sr-Cyrl','Градски дечји хор КЦЗР-а награђен Златном плакетом',NULL),(16980,68,'generic_element','datum','sr','2025-11-14',NULL),(16981,68,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(16982,68,'generic_element','opis','sr','Na petom Međunarodnom festivalu horova Melodianum u Kikindi, Gradski dečji hor Kulturnog centra Zrenjanina je nagrađen Zlatnom plaketom. Na reviji pobednika nastupali su najbolji horovi iz svake kategorije iz zemlje i inostranstva. Naš hor se predstavio svojim repertoarom rame uz rame sa najboljim horskim ansamblima iz Srbije, Makedonije, Slovačke, Rumunije i od stručnog žirija dobio najviše ocene i zlatno odličje.\r\nDirigent hora je Senka Milisavljević, korepetitor – Tina Nikolovski.',NULL),(16983,68,'generic_element','opis','sr-Cyrl','На петом Међународном фестивалу хорова Мелодианум у Кикинди, Градски дечји хор Културног центра Зрењанина је награђен Златном плакетом. На ревији победника наступали су најбољи хорови из сваке категорије из земље и иностранства. Наш хор се представио својим репертоаром раме уз раме са најбољим хорским ансамблима из Србије, Македоније, Словачке, Румуније и од стручног жирија добио највише оцене и златно одличје.\r\nДиригент хора је Сенка Милисављевић, корепетитор – Тина Николовски.',NULL),(16990,69,'generic_element','naslov','sr','Odluka žirija književnog konkursa \"Nova knjiga poezije\"',NULL),(16991,69,'generic_element','naslov','sr-Cyrl','Одлука жирија књижевног конкурса \"Нова књига поезије\"',NULL),(16992,69,'generic_element','datum','sr','2025-11-14',NULL),(16993,69,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(16994,69,'generic_element','opis','sr','U jakoj konkurenciji od 50 pristiglih zbirki poezije iz Regiona i inostranstva na književni konkurs “Nova knjiga” koji je raspisao Kulturni centar Zrenjanina u saradnji sa IP Media 023 stručni žiri je odlučio da prvu nagradu u vidu štampanja i promovisanja knjige dobije zbirka pod nazivom “Neman(a)” koju je poslala Beba Loma iz Beograda.\r\nZahvalnice i priliku da budu promovisane dobiće i zbirke sledećih autora: “Uškop jezik” Stevan Perić – Lukićevo, “Muškarci sa Šubarama” Adi Jašarević iz Zenice i “Jezikom pustinjskog vetra” Dragana Jovančević iz Pančeva.\r\nOdluka nije doneta jednoglasno pošto su mišljenja bila podeljena. Članovi žirija Nemanja Savić i Maja Pandurov su se usaglasili oko zbirke “Neman(a)” dok je Perica Markov izdvojio “Uškop jezik”.\r\nPosebna pohvala za književni napredak sledi mladom Simeonu Cerovini iz Beograda za dve zbirke poezije “Plafoni i ostala otkrića” i “Uspeva mi da ne poludim”.\r\n\r\nU Zrenjaninu 23. 4.2025.\r\nMaja Pandurov',NULL),(16995,69,'generic_element','opis','sr-Cyrl','У јакој конкуренцији од 50 пристиглих збирки поезије из Региона и иностранства на књижевни конкурс “Нова књига” који је расписао Културни центар Зрењанина у сарадњи са ИП Медиа 023 стручни жири је одлучио да прву награду у виду штампања и промовисања књиге добије збирка под називом “Неман(а)” коју је послала Беба Лома из Београда.\r\nЗахвалнице и прилику да буду промовисане добиће и збирке следећих аутора: “Ушкоп језик” Стеван Перић – Лукићево, “Мушкарци са Шубарама” Ади Јашаревић из Зенице и “Језиком пустињског ветра” Драгана Јованчевић из Панчева.\r\nОдлука није донета једногласно пошто су мишљења била подељена. Чланови жирија Немања Савић и Маја Пандуров су се усагласили око збирке “Неман(а)” док је Перица Марков издвојио “Ушкоп језик”.\r\nПосебна похвала за књижевни напредак следи младом Симеону Церовини из Београда за две збирке поезије “Плафони и остала открића” и “Успева ми да не полудим”.\r\n\r\nУ Зрењанину 23. 4.2025.\r\nМаја Пандуров',NULL),(17005,71,'generic_element','naslov','sr','11. maja počinje emitovanje Supersu kviza',NULL),(17006,71,'generic_element','naslov','sr-Cyrl','11. маја почиње емитовање Суперсу квиза',NULL),(17007,71,'generic_element','datum','sr','2025-11-14',NULL),(17008,71,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(17009,71,'generic_element','opis','sr','U nedelju, 11. maja na YouTube kanalu Kulturnog centra Zrenjanina počinje emitovanje prve emisije 10. jubilarne sezone Supersu kviza. Kviz je sniman u trajanju od šest epizoda koje će se emitovati jednom sedmično u narednih šest nedelja sa početkom u 11 časova.\r\nSupersu kviz – takmičenje namenjeno je učenicima viših razreda osnovnih škola. Ove godine učestvovalo je 16 ekipa osnovnih škola iz Zrenjanina i okolnih naseljenih mesta. Učenici su u formi takmičenja pokazali znanje iz različitih oblasti školskog gradiva i opšte kulture.\r\nSvi takmičari su nagrađeni prigodnim poklonima sponzora, a pobednici su osvajili vredne nagrade u vidu putovanja. Na kraju serijala saznaćete i imena najuspešnijih ekipa.\r\n\r\nKviz je organizovan i sniman u produkciji Kulturnog centra Zrenjanina a pod generealnim pokroviteljstvom Persu marketa.\r\n\r\n \r\n\r\nPrijatelji kviza:\r\nPersu marketi\r\nAkvapark Jagodina\r\nAkvapark Petrolend\r\nMrkšićevi salaši\r\nBeohemija doo\r\nMlekoprodukt\r\nBirooprema\r\nIron – sportska oprema i rekviziti\r\nKraljeva voda',NULL),(17010,71,'generic_element','opis','sr-Cyrl','У недељу, 11. маја на YоуТубе каналу Културног центра Зрењанина почиње емитовање прве емисије 10. јубиларне сезоне Суперсу квиза. Квиз је сниман у трајању од шест епизода које ће се емитовати једном седмично у наредних шест недеља са почетком у 11 часова.\r\nСуперсу квиз – такмичење намењено је ученицима виших разреда основних школа. Ове године учествовало је 16 екипа основних школа из Зрењанина и околних насељених места. Ученици су у форми такмичења показали знање из различитих области школског градива и опште културе.\r\nСви такмичари су награђени пригодним поклонима спонзора, а победници су освајили вредне награде у виду путовања. На крају серијала сазнаћете и имена најуспешнијих екипа.\r\n\r\nКвиз је организован и сниман у продукцији Културног центра Зрењанина а под генереалним покровитељством Персу маркета.\r\n\r\n \r\n\r\nПријатељи квиза:\r\nПерсу маркети\r\nАквапарк Јагодина\r\nАквапарк Петроленд\r\nМркшићеви салаши\r\nБеохемија доо\r\nМлекопродукт\r\nБироопрема\r\nИрон – спортска опрема и реквизити\r\nКраљева вода',NULL),(17011,71,'generic_element','link','sr','https://youtu.be/72XmWEacpzs',NULL),(17012,71,'generic_element','link','sr-Cyrl','https://youtu.be/72XmWEacpzs',NULL),(17013,71,'generic_element','link','en','https://youtu.be/72XmWEacpzs',NULL),(17014,72,'generic_element','naslov','sr','Prijave za ZROK fest 2025.',NULL),(17015,72,'generic_element','naslov','sr-Cyrl','Пријаве за ЗРОК фест 2025.',NULL),(17016,72,'generic_element','datum','sr','2025-11-14',NULL),(17017,72,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(17018,72,'generic_element','opis','sr','Kulturni centar Zrenjanina poziva sve zrenjaninske bendove da se prijave za učešće na manifestaciji ZROK fest koja će biti održana tokom jula i prve nedelje avgusta u sledećim terminima: 5, 12, 19, 26. jul i 2. avgust. Bendovi mogu da se prijave putem mejla na adresu: kczr@kczr.org do 20. juna 2025.\r\nUz prijavu sa osnovnim podacima o bendu treba poslati i fotografiju u visokoj rezoluciji i datum koji bendu odgovara.',NULL),(17019,72,'generic_element','opis','sr-Cyrl','Културни центар Зрењанина позива све зрењанинске бендове да се пријаве за учешће на манифестацији ЗРОК фест која ће бити одржана током јула и прве недеље августа у следећим терминима: 5, 12, 19, 26. јул и 2. август. Бендови могу да се пријаве путем мејла на адресу: кцзр@кцзр.орг до 20. јуна 2025.\r\nУз пријаву са основним подацима о бенду треба послати и фотографију у високој резолуцији и датум који бенду одговара.',NULL),(17020,73,'generic_element','naslov','sr','U Kulturnom centru Zrenjanina otvoren je 16. Stripolis',NULL),(17021,73,'generic_element','naslov','sr-Cyrl','У Културном центру Зрењанина отворен је 16. Стриполис',NULL),(17022,73,'generic_element','datum','sr','2025-11-14',NULL),(17023,73,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(17024,73,'generic_element','opis','sr','Otvaranje, kao i prethodnih godina, usmereno je ka najmlađoj publici koja je učestvovala na kospleju, predstavljajući čuvene strip junake i animirane likove posetiocima festivala. U naredna dva dana publika ima priliku da uživa u razgovorima sa autorima, gostima festivala, organizuje se radionica o kreiranju strip priče, izložbe, filmska projekcija, programi posvećeni tzv. devetoj umetnosti. Od samog početka festivalski program je zamišljen kao umetnička kota na kojoj će se desiti sinergija između posetilaca i učesnika, između onih koji su profesionalni umetnici, onih koji to tek žele da postanu, ali i onih koji samo žele da probude svoju umetničku stranu ličnosti.\r\n\r\nOrganizator festivala: Kulturni centar Zrenjanina\r\nAutor projekta: Mr Branko Đukić\r\nPokrovitelji festivala: Grad Zrenjanin i Voda Jazak.\r\nFestival se realizuje u okviru progama Zrenjanin – prestonica kulture Srbije 2025.\r\n\r\nO ovogodišnjem “Stripolisu”, Branko Đukić, likovni umetnik i autor projekta navodi sledeće:\r\n“Redovnim i propratnim programima, pokušaćemo da ukažemo na začetke i naznake onoga što bi moglo da ukazuje na pojavu i razvoj stripa i popularne kulture i na trenutna dešavanja, na ovom podneblju. Prošlost i istorijske činjenice regiona Srednjeg Banata (Zrenjanin i okolina) ukazuju da je on već početkom dvadesetog veka “obilovao” potencijalnim palp-herojima i događajima o kojima se i danas priča.\r\nPod sloganom “Strip Cirkus” cilj i namera ovogodišnje manifestacije je da metaforički simulira tematsku korelaciju između lokalne sredine, događaja i ličnosti koji su bili inspiracija za nastanak palp-junaka poput Džejmsa Bonda (Dušan Popov), Tarzana (Džoni Vajsmiler) i cirkuskih predstava koje je Bufalo Bil 1906. održao u Bečkereku… Biće to svojevrsni omaž istoriji subkulturnih pojava na ovim prostorima, ali i diskurzivnoj konstrukciji identiteta.”',NULL),(17025,73,'generic_element','opis','sr-Cyrl','Отварање, као и претходних година, усмерено је ка најмлађој публици која је учествовала на косплеју, представљајући чувене стрип јунаке и анимиране ликове посетиоцима фестивала. У наредна два дана публика има прилику да ужива у разговорима са ауторима, гостима фестивала, организује се радионица о креирању стрип приче, изложбе, филмска пројекција, програми посвећени тзв. деветој уметности. Од самог почетка фестивалски програм је замишљен као уметничка кота на којој ће се десити синергија између посетилаца и учесника, између оних који су професионални уметници, оних који то тек желе да постану, али и оних који само желе да пробуде своју уметничку страну личности.\r\n\r\nОрганизатор фестивала: Културни центар Зрењанина\r\nАутор пројекта: Мр Бранко Ђукић\r\nПокровитељи фестивала: Град Зрењанин и Вода Јазак.\r\nФестивал се реализује у оквиру прогама Зрењанин – престоница културе Србије 2025.\r\n\r\nО овогодишњем “Стриполису”, Бранко Ђукић, ликовни уметник и аутор пројекта наводи следеће:\r\n“Редовним и пропратним програмима, покушаћемо да укажемо на зачетке и назнаке онога што би могло да указује на појаву и развој стрипа и популарне културе и на тренутна дешавања, на овом поднебљу. Прошлост и историјске чињенице региона Средњег Баната (Зрењанин и околина) указују да је он већ почетком двадесетог века “обиловао” потенцијалним палп-херојима и догађајима о којима се и данас прича.\r\nПод слоганом “Стрип Циркус” циљ и намера овогодишње манифестације је да метафорички симулира тематску корелацију између локалне средине, догађаја и личности који су били инспирација за настанак палп-јунака попут Џејмса Бонда (Душан Попов), Тарзана (Џони Вајсмилер) и циркуских представа које је Буфало Бил 1906. одржао у Бечкереку… Биће то својеврсни омаж историји субкултурних појава на овим просторима, али и дискурзивној конструкцији идентитета.”',NULL),(17026,74,'generic_element','naslov','sr','Dvadeseti likovni konkurs \"30x30\"',NULL),(17027,74,'generic_element','naslov','sr-Cyrl','Двадесети ликовни конкурс \"30x30\"',NULL),(17028,74,'generic_element','datum','sr','2025-11-14',NULL),(17029,74,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(17030,74,'generic_element','opis','sr','Kulturni Centar Zrenjanina i autor projekta mr Milutin Mićić raspisuju 20. Likovni konkurs 30 puta 30. Autori mogu da konkurišu sa jednim radom. Radovi mogu da budu dvodimenzionalni i trodimenzionalni u svim tehnikama i disciplinama. Jedino ograničenje je da dvodimenzionalni radovi moraju biti formata 30 sa 30 santimetara. Pored slobodnih rešenja, ove godine autorima je ponuđena i mogućnost da promišljaju na zadatu temu-zadatak: “Strahovanja”. Radovi se šalju na adresu Kulturnog centra Zrenjanina, Narodne omladine 1. 23000 Zrenjanin. Konkurs je otvoren do 15. novembra 2025. godine.',NULL),(17031,74,'generic_element','opis','sr-Cyrl','Културни Центар Зрењанина и аутор пројекта мр Милутин Мићић расписују 20. Ликовни конкурс 30 пута 30. Аутори могу да конкуришу са једним радом. Радови могу да буду дводимензионални и тродимензионални у свим техникама и дисциплинама. Једино ограничење је да дводимензионални радови морају бити формата 30 са 30 сантиметара. Поред слободних решења, ове године ауторима је понуђена и могућност да промишљају на задату тему-задатак: “Страховања”. Радови се шаљу на адресу Културног центра Зрењанина, Народне омладине 1. 23000 Зрењанин. Конкурс је отворен до 15. новембра 2025. године.',NULL),(17032,75,'generic_element','naslov','sr','Konkurs za izlaganje u Izložbenom salonu KCZR-a za 2026. godinu',NULL),(17033,75,'generic_element','naslov','sr-Cyrl','Конкурс за излагање у Изложбеном салону КЦЗР-а за 2026. годину',NULL),(17034,75,'generic_element','datum','sr','2025-11-14',NULL),(17035,75,'generic_element','datum','sr-Cyrl','2025-11-14',NULL),(17036,75,'generic_element','opis','sr','Kulturni centar Zrenjanina raspisuje konkurs za samostalne i grupne izložbe za izlagačku 2026. godinu. Pravo učešća na konkursu imaju svi akademski likovni, primenjeni i multimedijalni umetnici, grupe i udruženja umetnika. Konkurs je otvoren do 20. novembra 2025. godine.',NULL),(17037,75,'generic_element','opis','sr-Cyrl','Културни центар Зрењанина расписује конкурс за самосталне и групне изложбе за излагачку 2026. годину. Право учешћа на конкурсу имају сви академски ликовни, примењени и мултимедијални уметници, групе и удружења уметника. Конкурс 