50,125,'generic_element','opis','sr','Manifestacija “Banatska bajka – Leto u Gradskoj bašti” zajedno sa Karavanom Banatske bajke održaće se ove godine po deveti put od sredine juna do kraja avgusta, sa pauzom za “Dane piva”. Predviđeno je da za 72 dana bude održano oko 100 programa. Imajući u vidu da je Kulturni centar Zrenjanina od 2016. godine počeo da raspolaže prostorom Gradske bašte, tada smo počeli i sa organizacijon programa, kulturno umetničkih sadržaja za sve generacije. Dve hiljade devetnaeste godine, manifestacija je proširila svoj programski i organizacioni okvir na taj način što se predviđeni programi pored prostora Gradske bašte odvijaju i u par okolnih naseljenih mesta u toku seoskih manifestacija. Program u Gradskoj bašti realizuje se tokom cele nedelje. Ponedeljkom se organizuju muzičke i filmske večeri. Utorak je predviđen za program pod nazivom: “Vinske priče”, sredom se organizuju multimedijalne večeri u kojima učestvuju književnici, glumci, muzičari, nastupaju bendovi, izvode umetnički performansi. Četvrtak je rezervisan za dečje programe kroz organizaciju niza kreativnih radionica, dečjih predstava i filmskih projekcija. Petkom i subotom organizuju se zabavne večeri uz evergrin muziku. Filmske projekcije organizuju se i poslednjeg dana u nedelji u večernjem terminu od 20 časova. Nedeljom se predstavljaju i folklorna udruženja.\r\n\r\nOrganizatori manifestacije su Kulturni centar Zrenjanina, IP Media 023 i Turistička organizacija.\r\nPokrovitelj je Grad Zrenjanin.',NULL),(17651,125,'generic_element','opis','sr-Cyrl','Манифестација “Банатска бајка – Лето у Градској башти” заједно са Караваном Банатске бајке одржаће се ове године по девети пут од средине јуна до краја августа, са паузом за “Дане пива”. Предвиђено је да за 72 дана буде одржано око 100 програма. Имајући у виду да је Културни центар Зрењанина од 2016. године почео да располаже простором Градске баште, тада смо почели и са организацијон програма, културно уметничких садржаја за све генерације. Две хиљаде деветнаесте године, манифестација је проширила свој програмски и организациони оквир на тај начин што се предвиђени програми поред простора Градске баште одвијају и у пар околних насељених места у току сеоских манифестација. Програм у Градској башти реализује се током целе недеље. Понедељком се организују музичке и филмске вечери. Уторак је предвиђен за програм под називом: “Винске приче”, средом се организују мултимедијалне вечери у којима учествују књижевници, глумци, музичари, наступају бендови, изводе уметнички перформанси. Четвртак је резервисан за дечје програме кроз организацију низа креативних радионица, дечјих представа и филмских пројекција. Петком и суботом организују се забавне вечери уз евергрин музику. Филмске пројекције организују се и последњег дана у недељи у вечерњем термину од 20 часова. Недељом се представљају и фолклорна удружења.\r\n\r\nОрганизатори манифестације су Културни центар Зрењанина, ИП Медиа 023 и Туристичка организација.\r\nПокровитељ је Град Зрењанин.',NULL),(17652,126,'generic_element','naslov','sr','Zrenjanin zove (festival alternativnog zvuka)',NULL),(17653,126,'generic_element','naslov','sr-Cyrl','Зрењанин зове (фестивал алтернативног звука)',NULL),(17654,126,'generic_element','opis','sr','U toku avgusta u Amfiteatru Kulturnog centra Zrenjanina u okviru gradske manifestacije “Dani piva” održava se muzički festival “Zrenjanin zove”. Osnovni koncept festivala čine nastupi rokenrol bendova, predstavljanje autorskih bendova i pregled muzičkih aktuelnosti. Zrenjanin zove započeo je 2012. godine kao memorijalni (sećanje na rano preminulog zrenjaninskog muzičara, basistu Sašu Šipčića – Šipku), a tokom godina održavanja i organizovanja prerastao je u festival alternativnog zvuka.\r\n\r\nOrganizator festivala:\r\nKulturni centar Zrenjanina\r\nPokrovitelji festivala:\r\nGrad Zrenjanin\r\nPrijatelj festivala:\r\n“PerSu marketi”\r\n\r\nUlaz je slobodan.',NULL),(17655,126,'generic_element','opis','sr-Cyrl','У току августа у Амфитеатру Културног центра Зрењанина у оквиру градске манифестације “Дани пива” одржава се музички фестивал “Зрењанин зове”. Основни концепт фестивала чине наступи рокенрол бендова, представљање ауторских бендова и преглед музичких актуелности. Зрењанин зове започео је 2012. године као меморијални (сећање на рано преминулог зрењанинског музичара, басисту Сашу Шипчића – Шипку), а током година одржавања и организовања прерастао је у фестивал алтернативног звука.\r\n\r\nОрганизатор фестивала:\r\nКултурни центар Зрењанина\r\nПокровитељи фестивала:\r\nГрад Зрењанин\r\nПријатељ фестивала:\r\n“ПерСу маркети”\r\n\r\nУлаз је слободан.',NULL),(17656,127,'generic_element','naslov','sr','Međunarodni likovni konkurs 30x30',NULL),(17657,127,'generic_element','naslov','sr-Cyrl','Међународни ликовни конкурс 30x30',NULL),(17658,127,'generic_element','opis','sr','Kulturni centar Zrenjanina i autor projekta mr Milutin Mićić od 2005. godine uspešno raspisuju likovni konkurs 30×30. Ovaj projekat je međunarodnog karaktera. Svake godine oko 300 autora šalje svoje radove na ovaj konkurs.\r\nProjekat je otvoren za dvodimenzionalne i trodimenzionalne radove u svim tehnikama i disciplinama. Jedino ograničenje je da dvodimenzionalni radovi moraju biti formata 30 sa 30 santimetara. Kod trodimenzionalnih radova jedna dimenzija treba da bude 30 santimetara, a ostale dve ne smeju da budu veće od 30 santimetara.\r\nPored slobodnih rešenja, ovaj projekat nudi autorima i mogućnost da promišljaju na zadatu temu-zadatak.\r\nSmatramo da je mišljenje umetnika o dešavanjima u svetu zapostavljeno, a da je vredno i dragoceno.\r\n\r\nKonkurs se raspisuje početkom septembra, zatvara sredinom novembra a nakon žiriranja pristiglih radova proglašavaju se najuspešniji. Pored dodele tri nagrade, žiri odlučuje i o radovima i autorima koji će se predstavite na Likovnom salonu 30X30. Nakon zrenjaninske premijere, salon gostuje u Beogradu, Pančevu, Sremskoj Mitrovici, Novom Sadu i Požegi.',NULL),(17659,127,'generic_element','opis','sr-Cyrl','Културни центар Зрењанина и аутор пројекта мр Милутин Мићић од 2005. године успешно расписују ликовни конкурс 30×30. Овај пројекат је међународног карактера. Сваке године око 300 аутора шаље своје радове на овај конкурс.\r\nПројекат је отворен за дводимензионалне и тродимензионалне радове у свим техникама и дисциплинама. Једино ограничење је да дводимензионални радови морају бити формата 30 са 30 сантиметара. Код тродимензионалних радова једна димензија треба да буде 30 сантиметара, а остале две не смеју да буду веће од 30 сантиметара.\r\nПоред слободних решења, овај пројекат нуди ауторима и могућност да промишљају на задату тему-задатак.\r\nСматрамо да је мишљење уметника о дешавањима у свету запостављено, а да је вредно и драгоцено.\r\n\r\nКонкурс се расписује почетком септембра, затвара средином новембра а након жирирања пристиглих радова проглашавају се најуспешнији. Поред доделе три награде, жири одлучује и о радовима и ауторима који ће се представите на Ликовном салону 30X30. Након зрењанинске премијере, салон гостује у Београду, Панчеву, Сремској Митровици, Новом Саду и Пожеги.',NULL),(17660,128,'generic_element','naslov','sr','Dečji kviz \"SuPersu\"',NULL),(17661,128,'generic_element','naslov','sr-Cyrl','Дечји квиз \"СуПерсу\"',NULL),(17662,128,'generic_element','opis','sr','Kviz je namenjen učenicima od petog do osmog razreda osnovnih škola Zrenjanina i okolnih naseljenih mesta. Takmiči se oko 36 ekipa iz 15 škola. Kviz je pokrenut sa idejom da se kroz druženje i upoznavanje proveri znanje iz opšte kulture i različitih oblasti školskog gradiva viših razreda osnovne škole. Svi takmičari se nagrađuju prigodnim poklonima sponzora, a pobednici osvojaju vredne nagrade u vidu putovanja. Članovi kviz žirija su: Rako Tomović – profesor istorije koji je i predsednik žirija, prof. dr tehničkih nauka Sanja Stanisavljev i Vladimir Đurić – pomoćnik direktora i rukovodilac programske službe Kulturnog centra Zrenjanina.\r\nKviz je urađen u produkciji Kulturnog centra Zrenjanina, a pod generalnim pokroviteljstvom PerSu marketa. Jednako značajni pokrovitelji i prijatelji “SuPersu” kviza su: “Akvapark Jagodina” i “Akvapark Petrolend”.',NULL),(17663,128,'generic_element','opis','sr-Cyrl','Квиз је намењен ученицима од петог до осмог разреда основних школа Зрењанина и околних насељених места. Такмичи се око 36 екипа из 15 школа. Квиз је покренут са идејом да се кроз дружење и упознавање провери знање из опште културе и различитих области школског градива виших разреда основне школе. Сви такмичари се награђују пригодним поклонима спонзора, а победници освојају вредне награде у виду путовања. Чланови квиз жирија су: Рако Томовић – професор историје који је и председник жирија, проф. др техничких наука Сања Станисављев и Владимир Ђурић – помоћник директора и руководилац програмске службе Културног центра Зрењанина.\r\nКвиз је урађен у продукцији Културног центра Зрењанина, а под генералним покровитељством ПерСу маркета. Једнако значајни покровитељи и пријатељи “СуПерсу” квиза су: “Аквапарк Јагодина” и “Аквапарк Петроленд”.',NULL),(17664,129,'generic_element','naslov','sr','Gradski dečji hor Kulturnog centra Zrenjanina',NULL),(17665,129,'generic_element','naslov','sr-Cyrl','Градски дечји хор Културног центра Зрењанина',NULL),(17666,129,'generic_element','opis','sr','Hor okuplja talentovanu i muzikalnu decu osnovnoškolskog i srednjoškolskog uzrasta (od 8 do 16 godina) , koja pokazuju posebnu nadarenost za muziku. Pevanjem u horu deca razvijaju svoje talente, uče muziku i upoznaju se sa svim žanrovima umetničke muzike. Hor neguje muzičko vaspitanje dece kroz ozbiljan, profesionalni rad horskog dirigenta na muzici svih epoha, od rane muzike, renesanse, starih majstora, baroka, klasicizma, preko romantizma, muzike XX veka i savremene muzike, i to svih stilova: svetovne, duhovne muzike, narodne pesme, džez standarda, filmske muzike i rokenrola. Akcenat je na srpskoj muzici i delima srpskih kompozitora.\r\nHor krasi izrazita karakteristična boja i moćan zvuk uz tačnu i prefinjenu intonaciju, lakoća pevanja uz posebnu nadahnutost i emociju koja se ogleda u izuzetnom odnosu i razumevanju dirigenta i malih pevača. Deca pevanjem u horu stiču osećaj za estetiku i etiku ne samo muzike, nego umetnosti uopšte i izgrađuju svoje umetničko i kritičko mišljenje koje je sastavni deo vaspitanja i odrastanja uz pravi sistem vrednosti. Hor aktivno učestvuje u kulturi svoga grada i na najbolji način ga predstavlja širom Srbije.\r\nOdlasci hora na festivale i takmičenja u zemlji i regionu, i osvajanja najviših nagrada, priznanja i diploma je svakako nešto na šta smo izuzetno ponosni.\r\nHorom diriguje magistar umetnosti Senka Milisavljević. Stalni korepetitor hora je prof. Tina Nikolovski a muzički saradnici i korepetitori su: magistar umetnosti, flautistkinja Vesna Vučurević i prof. Milan Milisavljević.\r\n\r\nKontakt – prijave za zainteresovane:\r\ne-mail: kczr@kczr.org\r\ntelefon: 023/566-712',NULL),(17667,129,'generic_element','opis','sr-Cyrl','Хор окупља талентовану и музикалну децу основношколског и средњошколског узраста (од 8 до 16 година) , која показују посебну надареност за музику. Певањем у хору деца развијају своје таленте, уче музику и упознају се са свим жанровима уметничке музике. Хор негује музичко васпитање деце кроз озбиљан, професионални рад хорског диригента на музици свих епоха, од ране музике, ренесансе, старих мајстора, барока, класицизма, преко романтизма, музике XX века и савремене музике, и то свих стилова: световне, духовне музике, народне песме, џез стандарда, филмске музике и рокенрола. Акценат је на српској музици и делима српских композитора.\r\nХор краси изразита карактеристична боја и моћан звук уз тачну и префињену интонацију, лакоћа певања уз посебну надахнутост и емоцију која се огледа у изузетном односу и разумевању диригента и малих певача. Деца певањем у хору стичу осећај за естетику и етику не само музике, него уметности уопште и изграђују своје уметничко и критичко мишљење које је саставни део васпитања и одрастања уз прави систем вредности. Хор активно учествује у култури свога града и на најбољи начин га представља широм Србије.\r\nОдласци хора на фестивале и такмичења у земљи и региону, и освајања највиших награда, признања и диплома је свакако нешто на шта смо изузетно поносни.\r\nХором диригује магистар уметности Сенка Милисављевић. Стални корепетитор хора је проф. Тина Николовски а музички сарадници и корепетитори су: магистар уметности, флаутисткиња Весна Вучуревић и проф. Милан Милисављевић.\r\n\r\nКонтакт – пријаве за заинтересоване:\r\nе-маил: кцзр@кцзр.орг\r\nтелефон: 023/566-712',NULL),(17668,130,'generic_element','naslov','sr','Stripolis',NULL),(17669,130,'generic_element','naslov','sr-Cyrl','Стриполис',NULL),(17670,130,'generic_element','opis','sr','Prve korake vezane za projekat “Stripolis” beležimo 2008. godine objavljivanjem Zrenjaninskog strip almanaha u okviru izdavačke produkcije Kulturnog centra. Nakon toga, već u toku 2009. počinjemo sa objavljivanjem časopisa internacionalnog i autorskog stripa “Stripolis”. Imajuću u vidu veliki broj zainteresovane publike i poštovalaca “devete umetnosti” Kulturni centar u saradnji sa Brankom Đukićem, autorom projekta i urednikom časopisa, iste godine počinje i organizaciju istoimenog festivala.\r\n“Stripolis” je festival koji svake godine ugosti eminentne stvaraoce ovog i srodnih medija. Festival je specifičan po tome što je posvećen pretežno autorskom stripu i izdavanju istoimenog časopisa koji objavljuje ovakvu vrstu stripova. Kroz raznovrsne programe poput izložbi, radionica, bioskopskih projekcija, okruglih stolova, festival doprinosi revitalizaciji i afirmaciji domaćeg strip stvaralaštva, izdavaštva kao i sveukupnoj popularizaciji ovog medija. Specifičnost festivala ogleda se i u pokušaju prikaza prožimanja poetike stripa sa drugim umetnostima poput pozorišta, filma, slikarstva, književnosti i muzike.\r\nSvake godine, organizuje se sredinom septembra u trodnevnom trajanju kada se, na više lokacija u gradu, očekuju mnogobrojni gosti, strip izdavači, izlagači kolekcionarskih figura, strip crtači, održava cosplay u okviru svečanog otvaranja, organizuju izložbe, razgovori na temu stripa, projekcije i radionice i predstavlja najnoviji broj časopisa.\r\nPromocija časopisa, koji je početak i osnov zrenjaninske “strip priče”, organizuje se u više gradova, nakon završenog festivala.',NULL),(17671,130,'generic_element','opis','sr-Cyrl','Прве кораке везане за пројекат “Стриполис” бележимо 2008. године објављивањем Зрењанинског стрип алманаха у оквиру издавачке продукције Културног центра. Након тога, већ у току 2009. почињемо са објављивањем часописа интернационалног и ауторског стрипа “Стриполис”. Имајућу у виду велики број заинтересоване публике и поштовалаца “девете уметности” Културни центар у сарадњи са Бранком Ђукићем, аутором пројекта и уредником часописа, исте године почиње и организацију истоименог фестивала.\r\n“Стриполис” је фестивал који сваке године угости еминентне ствараоце овог и сродних медија. Фестивал је специфичан по томе што је посвећен претежно ауторском стрипу и издавању истоименог часописа који објављује овакву врсту стрипова. Кроз разноврсне програме попут изложби, радионица, биоскопских пројекција, округлих столова, фестивал доприноси ревитализацији и афирмацији домаћег стрип стваралаштва, издаваштва као и свеукупној популаризацији овог медија. Специфичност фестивала огледа се и у покушају приказа прожимања поетике стрипа са другим уметностима попут позоришта, филма, сликарства, књижевности и музике.\r\nСваке године, организује се средином септембра у тродневном трајању када се, на више локација у граду, очекују многобројни гости, стрип издавачи, излагачи колекционарских фигура, стрип цртачи, одржава цосплаy у оквиру свечаног отварања, организују изложбе, разговори на тему стрипа, пројекције и радионице и представља најновији број часописа.\r\nПромоција часописа, који је почетак и основ зрењанинске “стрип приче”, организује се у више градова, након завршеног фестивала.',NULL),(17672,131,'generic_element','naslov','sr','Horski festival \"Slobodan Bursać\"',NULL),(17673,131,'generic_element','naslov','sr-Cyrl','Хорски фестивал \"Слободан Бурсаћ\"',NULL),(17674,131,'generic_element','opis','sr','Horski festival “Slobodan Bursać” osnovan je 2014. godine sa idejom da bi grad Zrenjanin, koji ima višedecenijsku horsku tradiciju, trebalo da ima i horski festival koji će podstaći dalji razvoj horskog pevanja i stvoriti nove naraštaje horskih pevača i publike. Svake godine, u junu mesecu, na festivalu nastupaju svi zrenjaninski horovi, kao i gostujući horovi iz zemlje i inostranstva. O značaju horske muzike u ovom gradu govori podatak da je Zrenjanin u Srbiji, ali i u regionu, prema broju stanovnika, grad sa najviše horova. Izuzetno važna ličnost za razvoj horske muzike u Zrenjaninu je bio dirigent Slobodan Bursać (1941–1993), sa kojim je Omladinski mešoviti hor “Josif Marinković” iz Zrenjanina osvojio brojna priznanja, među kojima i titulu “Hor sveta” u Langolenu u Velikoj Britaniji 1987. godine. On je svojim entuzijazmom i dirigentskom harizmom stvorio generacije pevača, od kojih su mnogi danas angažovani u profesionalnim ansamblima u Srbiji i inostranstvu.',NULL),(17675,131,'generic_element','opis','sr-Cyrl','Хорски фестивал “Слободан Бурсаћ” основан је 2014. године са идејом да би град Зрењанин, који има вишедеценијску хорску традицију, требало да има и хорски фестивал који ће подстаћи даљи развој хорског певања и створити нове нараштаје хорских певача и публике. Сваке године, у јуну месецу, на фестивалу наступају сви зрењанински хорови, као и гостујући хорови из земље и иностранства. О значају хорске музике у овом граду говори податак да је Зрењанин у Србији, али и у региону, према броју становника, град са највише хорова. Изузетно важна личност за развој хорске музике у Зрењанину је био диригент Слободан Бурсаћ (1941–1993), са којим је Омладински мешовити хор “Јосиф Маринковић” из Зрењанина освојио бројна признања, међу којима и титулу “Хор света” у Ланголену у Великој Британији 1987. године. Он је својим ентузијазмом и диригентском харизмом створио генерације певача, од којих су многи данас ангажовани у професионалним ансамблима у Србији и иностранству.',NULL),(17676,132,'generic_element','naslov','sr-Cyrl','15. 11. Гусларско вече',NULL),(17677,132,'generic_element','naslov','sr','15. 11. Гусларско вече',NULL),(17678,132,'generic_element','opis','sr-Cyrl','Гусларско вече “Чувари историје културе и традиције” у организацији Културно-уметничког гусларског друштва “Петар Перуновиć – Перун” и Културног центра Зрењанина одржаćе се у суботу, 15. новембра са почетком у 19 часова.\nНаступиćе: Миломир Миљаниć, певач изворног народног мелоса, Милица Досковиć, вокална солисткиња, изворна женска певачка група “Наш осмех”, Љубиша Атељевиć, Љубомир Павловиć, Матија Милиниć и Александар Радовиć, гуслари, Гусларско друштво “Филип Вишњиć” из Бијељине и гуслари Жарко Лакиć, Вукан Đука и Лука Бошњак.\nГусларско вече одржава се у Великој сали Културног центра Зрењанина.',NULL),(17679,132,'generic_element','opis','sr','Гусларско вече “Чувари историје културе и традиције” у организацији Културно-уметничког гусларског друштва “Петар Перуновиć – Перун” и Културног центра Зрењанина одржаćе се у суботу, 15. новембра са почетком у 19 часова.\nНаступиćе: Миломир Миљаниć, певач изворног народног мелоса, Милица Досковиć, вокална солисткиња, изворна женска певачка група “Наш осмех”, Љубиша Атељевиć, Љубомир Павловиć, Матија Милиниć и Александар Радовиć, гуслари, Гусларско друштво “Филип Вишњиć” из Бијељине и гуслари Жарко Лакиć, Вукан Đука и Лука Бошњак.\nГусларско вече одржава се у Великој сали Културног центра Зрењанина.',NULL),(17680,133,'generic_element','naslov','sr-Cyrl','24. 11. Трибина \"22 најчешćа уверења која нас спутавају\"',NULL),(17681,133,'generic_element','naslov','sr','24. 11. Трибина \"22 најчешćа уверења која нас спутавају\"',NULL),(17682,133,'generic_element','opis','sr-Cyrl','Др Марко Јовашевиć, породични психотерапеут, у понедељак, 24. новембра у оквиру трибинског програма Културног центра Зрењанина одржаćе предавање под називом “22 најчешćа уверења која нас спутавају”. Јовашевиć се бави несвесним образцима размишљања који ограничавају наш потенцијал, самопоуздање и односе. Уз практичне примере и алате који помажу да их препознамо и променимо. Циљ овог разговора је да психолошке концепте учинимо разумљивим и примењивим у свакодневном животу. Разговор са др Марком Јовашевиćем водиćе Đорđо Прстојевиć уредник трибинског програма. Након предавања заинтересовани учесници имаćе прилику да набаве нови роман др Марка Јовашевиćа “Случајности не постоје”.\nТрибина почиње у 18 часова.',NULL),(17683,133,'generic_element','opis','sr','Др Марко Јовашевиć, породични психотерапеут, у понедељак, 24. новембра у оквиру трибинског програма Културног центра Зрењанина одржаćе предавање под називом “22 најчешćа уверења која нас спутавају”. Јовашевиć се бави несвесним образцима размишљања који ограничавају наш потенцијал, самопоуздање и односе. Уз практичне примере и алате који помажу да их препознамо и променимо. Циљ овог разговора је да психолошке концепте учинимо разумљивим и примењивим у свакодневном животу. Разговор са др Марком Јовашевиćем водиćе Đорđо Прстојевиć уредник трибинског програма. Након предавања заинтересовани учесници имаćе прилику да набаве нови роман др Марка Јовашевиćа “Случајности не постоје”.\nТрибина почиње у 18 часова.',NULL),(17684,134,'generic_element','naslov','sr-Cyrl','19. 11. Представа \"Анđела\"',NULL),(17685,134,'generic_element','naslov','sr','19. 11. Представа \"Анđела\"',NULL),(17686,134,'generic_element','opis','sr-Cyrl','Представа “Анđела” у којој играју Милутин Мима Караџиć, Горан Шушљик и Станислава Николиć биćе изведена на Великој сцени Културног центра Зрењанина у среду, 19. новембра са почетком у 20 часова. Реч је о романтичној, црнохуморној комедији ураđеној у режији Милана 