опа Србија повод је да се сви заинтересовани актери на културној сцени из Зрењанина и околине упознају са могуćностима и приликама програма Креативна Европа и информишу о отвореним конкурсима у оквиру потпрограма Култура и Меđусекторски, али и да добију основна сазнања о приоритетима програма, као и успешним пројектима. Такоđе, том приликом биćе разговора и о најчешćим препрекама за добијање средстава из Програма ЕУ као и искуства из земаља из региона и из ЕУ.',NULL),(17719,142,'generic_element','opis','sr','Инфо дан о ЕУ програму Креативна Европа одржаćе се 17. новембра 2025. године са почетком у 11 часова, у Малој сали Културног центра Зрењанин. Догаđај ćе бити реализован у сарадњи Културног центра Зрењанин и Антене Деска КЕ Србија, заједно са техничком подршком пројекта “Подршка Србији у учешćу у Програмима Уније”. Заједно са тимом техничке подршке показаćемо повезаност свих програма Уније као и важност умрежавања и сарадње кроз секторе и кроз институције.\nДогаđај у организацији Антене Деска Креативна Европа Србија повод је да се сви заинтересовани актери на културној сцени из Зрењанина и околине упознају са могуćностима и приликама програма Креативна Европа и информишу о отвореним конкурсима у оквиру потпрограма Култура и Меđусекторски, али и да добију основна сазнања о приоритетима програма, као и успешним пројектима. Такоđе, том приликом биćе разговора и о најчешćим препрекама за добијање средстава из Програма ЕУ као и искуства из земаља из региона и из ЕУ.',NULL),(17720,143,'generic_element','naslov','sr-Cyrl','22. 11. Промоција књиге Наде Срејиć Ландман \"Животна прича моје Милице\"',NULL),(17721,143,'generic_element','naslov','sr','22. 11. Промоција књиге Наде Срејиć Ландман \"Животна прича моје Милице\"',NULL),(17722,143,'generic_element','opis','sr-Cyrl','Промоција књиге “Животна прича моје Милице” коју је написала Нада Срејиć Ландман биćе одржана у Малој сали Културног центра Зрењанина у суботу, 22. новембра са почетком у 18 часова. Како ауторка наводи реч је о биографској новели, писаној у првом лицу у којој главна јунакиња шаље поруке и носи печат времена друге половине прошлог века. Књига се представља кроз уметнички програм у којем ćе учествовати Александра Крсман, Милена Радловачки и Мила Сташевиć.\nО књизи се наводи следеćе:\n“Милица Благојевиć доселила се са родитељима након Другог светског рата из Босне у Банат. Ту почиње једна потресна али јуначка прича обичне жене из народа која захваљујуćи свом позитивном карактеру успева да преброди сиромаштво, болест и остале недаćе. Милица је пуна духа, љубави и разумевања за све око себе. Оно што је крунише јесте смисао за хумор. Он провејава кроз све њене реакције као појас за спасавање. Њена прича шаље поруку и оставља печат времена из половине прошлог века.”',NULL),(17723,143,'generic_element','opis','sr','Промоција књиге “Животна прича моје Милице” коју је написала Нада Срејиć Ландман биćе одржана у Малој сали Културног центра Зрењанина у суботу, 22. новембра са почетком у 18 часова. Како ауторка наводи реч је о биографској новели, писаној у првом лицу у којој главна јунакиња шаље поруке и носи печат времена друге половине прошлог века. Књига се представља кроз уметнички програм у којем ćе учествовати Александра Крсман, Милена Радловачки и Мила Сташевиć.\nО књизи се наводи следеćе:\n“Милица Благојевиć доселила се са родитељима након Другог светског рата из Босне у Банат. Ту почиње једна потресна али јуначка прича обичне жене из народа која захваљујуćи свом позитивном карактеру успева да преброди сиромаштво, болест и остале недаćе. Милица је пуна духа, љубави и разумевања за све око себе. Оно што је крунише јесте смисао за хумор. Он провејава кроз све њене реакције као појас за спасавање. Њена прича шаље поруку и оставља печат времена из половине прошлог века.”',NULL),(17724,144,'generic_element','naslov','sr-Cyrl','23. 11. Берза грамофонских плоча',NULL),(17725,144,'generic_element','naslov','sr','23. 11. Берза грамофонских плоча',NULL),(17726,144,'generic_element','opis','sr-Cyrl','У Културном центру Зрењанина у недељу, 23. новембра од 10 до 14 часова биćе одржана берза плоча.\nИнформације: 061/2952592.',NULL),(17727,144,'generic_element','opis','sr','У Културном центру Зрењанина у недељу, 23. новембра од 10 до 14 часова биćе одржана берза плоча.\nИнформације: 061/2952592.',NULL),(17728,145,'generic_element','naslov','sr-Cyrl','27, 28. и 29. 11. АНИМАПОЛИС',NULL),(17729,145,'generic_element','naslov','sr','27, 28. и 29. 11. АНИМАПОЛИС',NULL),(17730,145,'generic_element','opis','sr-Cyrl','Први Фестивал анимираног филма “Анимаполис” одржаćе се од 27. до 29. новембра 2025. године у Зрењанину. Публика ćе имати прилику да ужива у обиљу догаđаја као што су пројекције стручно одабраних и квалитетно категоризованих анимираних филмова за децу и одрасле, разговорима са ауторима, “Стоп-Моушн”, “Гиф” и класичним радионицама анимације, округлим столовима, изложбама и неформалним окупљањима. Осим Културног центра Зрењанина догаđања ćе се одвијати на још неколико градских локација.\nЦиљ пројекта је развој креативних индустрија уз учешćе граđана у културном животу града. Овом манифестацијом указујемо на важност културе за целокупно друштво и дајемо допринос развоју креативности и критичког мишљења стварањем широке платформе за излазак оснажених уметника, креативних стваралаца и иноватора на меđународну сцену и приступ значајно широј публици и тржишту. Промоцијом иновативности и креативности, допринеćемо изградњи новог, позитивног имиџа Зрењанина. АнимаПолис ćе саживети са публиком и градом у којем настаје – наводи Бранко Đукиć, аутор пројекта.\nГости фестивала:\nРастко Ćириć – аниматор, стрип цртач, илустратор – Београд\nАлекса Гајиć – аниматор, стрип цртач – Земун\nБорислав Шајтинац – аниматор, карикатуриста, стрип цртач – Париз\nСтефан Митиć – Тиćми – писац за децу и одрасле – Лесковац\nМарко Стојановиć – стрип аутор и предавач – Лесковац\nДамир Романов – аниматор и продуцент – Панчево\nМарија Вулиć – аниматор и уметнички директор “Ани