зао троје људи што је доводи до првог псеćег суđења. Притиснута захтевима адвокатске канцеларије коју заступа нема избора осим да победи како иначе њен необични клијент не би био заувек успаван.\nЗанимљивост:\nПас, јунак филма освојио је је награду – “Псеćа палма”. Реч је о награди која се веć 21 годину додељује најбољем псу у актуелним филмовима. Комедија у судници са дивном поделом улога поставља питање о нашој вези са животињама, и све теже дефинисањем или тумачењем људских права у савременом свету препуном парадокса.\nТРЕЈЛЕР:\nхттпс://yоуту.бе/нГyWзТјСтЕМ?си=Мс4-н37ФрБОДДТхЗ',NULL),(17751,150,'generic_element','opis','sr','Ова политички некоректна комедија раđена по истинитом догаđају имала је своју светску премијеру у Кану.\nСинопсис:\nГлавна јунакиња филма Април, идеалистична адвокатица посвеćена такозваним “изгубљеним” случајевима пристаје да брани Космоса, пса који је угризао троје људи што је доводи до првог псеćег суđења. Притиснута захтевима адвокатске канцеларије коју заступа нема избора осим да победи како иначе њен необични клијент не би био заувек успаван.\nЗанимљивост:\nПас, јунак филма освојио је је награду – “Псеćа палма”. Реч је о награди која се веć 21 годину додељује најбољем псу у актуелним филмовима. Комедија у судници са дивном поделом улога поставља питање о нашој вези са животињама, и све теже дефинисањем или тумачењем људских права у савременом свету препуном парадокса.\nТРЕЈЛЕР:\nхттпс://yоуту.бе/нГyWзТјСтЕМ?си=Мс4-н37ФрБОДДТхЗ',NULL),(17752,151,'generic_element','naslov','sr-Cyrl','23. 11. Филм \"Ози - Глас шуме\"',NULL),(17753,151,'generic_element','naslov','sr','23. 11. Филм \"Ози - Глас шуме\"',NULL),(17754,151,'generic_element','opis','sr-Cyrl','Ози, малена орангутанка радозналог ума, спрема се да доживи велику, велику промену! Ози живи дубоко у прашуми са својим родитељима, Симом и ЈоЈо. Њихов живот је предиван и проводе га идилично, на крошњама дрвец́а, све док једне кобне ноц́и њихов дом у прашуми не уништи зла корпорација. Одвој