ва, у Малој сали Културног центра Зрењанин. Догађај ће бити реализован у сарадњи Културног центра Зрењанин и Антене Деска КЕ Србија, заједно са техничком подршком пројекта “Подршка Србији у учешћу у Програмима Уније”. Заједно са тимом техничке подршке показаћемо повезаност свих програма Уније као и важност умрежавања и сарадње кроз секторе и кроз институције.\r\nДогађај у организацији Антене Деска Креативна Европа Србија повод је да се сви заинтересовани актери на културној сцени из Зрењанина и околине упознају са могућностима и приликама програма Креативна Европа и информишу о отвореним конкурсима у оквиру потпрограма Култура и Међусекторски, али и да добију основна сазнања о приоритетима програма, као и успешним пројектима. Такође, том приликом биће разговора и о најчешћим препрекама за добијање средстава из Програма ЕУ као и искуства из земаља из региона и из ЕУ.',NULL),(17775,156,'generic_element','opis','sr','Инфо дан о ЕУ програму Креативна Европа одржаćе се 17. новембра 2025. године са почетком у 11 часова, у Малој сали Културног центра Зрењанин. Догаđај ćе бити реализован у сарадњи Културног центра Зрењанин и Антене Деска КЕ Србија, заједно са техничком подршком пројекта “Подршка Србији у учешćу у Програмима Уније”. Заједно са тимом техничке подршке показаćемо повезаност свих програма Уније као и важност умрежавања и сарадње кроз секторе и кроз институције.\r\nДогаđај у организацији Антене Деска Креативна Европа Србија повод је да се сви заинтересовани актери на културној сцени из Зрењанина и околине упознају са могуćностима и приликама програма Креативна Европа и информишу о отвореним конкурсима у оквиру потпрограма Култура и Меđусекторски, али и да добију основна сазнања о приоритетима програма, као и успешним пројектима. Такоđе, том приликом биćе разговора и о најчешćим препрекама за добијање средстава из Програма ЕУ као и искуства из земаља из региона и из ЕУ.',NULL),(17776,157,'generic_element','naslov','sr-Cyrl','22. 11. Промоција књиге Наде Срејић Ландман \"Животна прича моје Милице\"',NULL),(17777,157,'generic_element','naslov','sr','22. 11. Промоција књиге Наде Срејиć Ландман \"Животна прича моје Милице\"',NULL),(17778,157,'generic_element','opis','sr-Cyrl','Промоција књиге “Животна прича моје Милице” коју је написала Нада Срејић Ландман биће одржана у Малој сали Културног центра Зрењанина у суботу, 22. новембра са почетком у 18 часова. Како ауторка наводи реч је о биографској новели, писаној у првом лицу у којој главна јунакиња шаље поруке и носи печат времена друге половине прошлог века. Књига се представља кроз уметнички програм у којем ће учествовати Александра Крсман, Милена Радловачки и Мила Сташевић.\r\nО књизи се наводи следеће:\r\n“Милица Благојевић доселила се са родитељима након Другог светског рата из Босне у Банат. Ту почиње једна потресна али јуначка прича обичне жене из народа која захваљујући свом позитивном карактеру успева да преброди сиромаштво, болест и остале недаће. Милица је пуна духа, љубави и разумевања за све око себе. Оно што је крунише јесте смисао за хумор. Он провејава кроз све њене реакције као појас за спасавање. Њена прича шаље поруку и оставља печат времена из половине прошлог века.”',NULL),(17779,157,'generic_element','opis','sr','Промоција књиге “Животна прича моје Милице” коју је написала Нада Срејиć Ландман биćе одржана у Малој сали Културног центра Зрењанина у суботу, 22. новембра са почетком у 18 часова. Како ауторка наводи реч је о биографској новели, писаној у првом лицу у којој главна јунакиња шаље поруке и носи печат времена друге половине прошлог века. Књига се представља кроз уметнички програм у којем ćе учествовати Александра Крсман, Милена Радловачки и Мила Сташевиć.\r\nО књизи се наводи следеćе:\r\n“Милица Благојевиć доселила се са родитељима након Другог светског рата из Босне у Банат. Ту почиње једна потресна али јуначка прича обичне жене из народа која захваљујуćи свом позитивном карактеру успева да преброди сиромаштво, болест и остале недаćе. Милица је пуна 