ранко Ђукић, аутор пројекта.\r\nГости фестивала:\r\nРастко Ћирић – аниматор, стрип цртач, илустратор – Београд\r\nАлекса Гајић – аниматор, стрип цртач – Земун\r\nБорислав Шајтинац – аниматор, карикатуриста, стрип цртач – Париз\r\nСтефан Митић – Тићми – писац за децу и одрасле – Лесковац\r\nМарко Стојановић – стрип аутор и предавач – Лесковац\r\nДамир Романов – аниматор и продуцент – Панчево\r\nМарија Вулић – аниматор и уметнички директор “Аниматор Феста” – Јагодина\r\nЗлата и Јаков Попов -аниматори из Дома Анимације – Сремски Карловци\r\nБисерка Петровић – аниматорка и сликарка – Младеновац\r\nИван Прибићевић – продуцент куће ДигиталКрафт – Београд\r\nЗоран Стефановић – драматург и сценариста – Београд\r\nТеодор Ајдук – аниматор – Нови Сад\r\nИвона Будаи – Аниматорка – Зрењанин\r\nОрганизатор Анимаполиса је Културни центар Зрењанина.\r\nПројекат је део званичног програма Зрењанин – Престоница културе Србије 2025, суфинансираног из буџета Републике Србије – Министарства културе и Града Зрењанина.\r\nПријатељ фестивала: Вода Јазак.',NULL),(17787,159,'generic_element','opis','sr','Први Фестивал анимираног филма “Анимаполис” одржаćе се од 27. до 29. новембра 2025. године у Зрењанину. Публика ćе имати прилику да ужива у обиљу догаđаја као што су пројекције стручно одабраних и квалитетно категоризованих анимираних филмова за децу и одрасле, разговорима са ауторима, “Стоп-Моушн”, “Гиф” и класичним радионицама анимације, округлим столовима, изложбама и неформалним окупљањима. Осим Културног центра Зрењанина догаđања ćе се одвијати на још неколико градских локација.\r\nЦиљ пројекта је развој креативних индустрија уз учешćе граđана у културном животу града. Овом манифестацијом указујемо на важност културе за целокупно друштво и дајемо допринос развоју креативности и критичког мишљења стварањем широке платформе за излазак оснажених уметника, креативних стваралаца и иноватора на меđународну сцену и приступ значајно широј публици и тржишту. Промоцијом иновативности и креативности, допринеćемо изградњи новог, позитивног имиџа Зрењанина. АнимаПолис ćе саживети са публиком и градом у којем настаје – наводи Бранко Đукиć, аутор пројекта.\r\nГости фестивала:\r\nРастко Ćириć – аниматор, стрип цртач, илустратор – Београд\r\nАлекса Гајиć – аниматор, стрип цртач – Земун\r\nБорислав Шајтинац – аниматор, карикатуриста, стрип цртач – Париз\r\nСтефан Митиć – Тиćми – писац за децу и одрасле – Лесковац\r\nМарко Стојановиć – стрип аутор и предавач – Лесковац\r\nДамир Романов – аниматор и продуцент – Панчево\r\nМарија Вулиć – аниматор и уметнички директор “Аниматор Феста” – Јагодина\r\nЗлата и Јаков Попов -аниматори из Дома Анимације – Сремски Карловци\r\nБисерка Петровиć – аниматорка и сликарка – Младеновац\r\nИван Прибиćевиć – продуцент куćе ДигиталКрафт – Београд\r\nЗоран Стефановиć – драматург и сценариста – Београд\r\nТеодор Ајдук – аниматор – Нови Сад\r\nИвона Будаи – Аниматорка – Зрењанин\r\nОрганизатор Анимаполиса је Културни центар Зрењанина.\r\nПројекат је део званичног програма Зрењанин – Престоница културе Србије 2025, суфинансираног из буџета Републике Србије – Министарства културе и Града Зрењанина.\r\nПријатељ фестивала: Вода Јазак.',NULL),(17788,159,'generic_element','datum','sr','2025-11-29',NULL),(17789,159,'generic_element','datum','sr-Cyrl','2025-11-29',NULL),(17794,158,'generic_element','datum','sr','2025-11-23',NULL),(17795,158,'generic_element','datum','sr-Cyrl','2025-11-23',NULL),(17800,157,'generic_element','datum','sr','2025-11-22',NULL),(17801,157,'generic_element','datum','sr-Cyrl','2025-11-22',NULL),(17806,156,'generic_element','datum','sr','2025-11-17',NULL),(17807,156,'generic_element','datum','sr-Cyrl','2025-11-17',NULL),(17812,155,'generic_element','datum','sr','2025-11-13',NULL),(17813,155,'generic_element','datum','sr-Cyrl','2025-11-13',NULL),(17818,154,'generic_element','datum','sr','2025-11-30',NULL),(17819,154,'generic_element','datum','sr-Cyrl','2025-11-30',NULL),(17824,153,'generic_element','datum','sr','2025-11-30',N