вођење, квалитетне оброке, као и свакодневне креативне и едукативне активности.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_1b8274_d91ad3','sr','Cenovnik predškolske ustanove','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_1b8274_d91ad3','sr-Cyrl','Ценовник предшколске установе','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_259518_2d8f9e','sr','Celodnevni program:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_259518_2d8f9e','sr-Cyrl','Целодневни програм:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_2af07c_7fc86b','sr','Jaslice:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_2af07c_7fc86b','sr-Cyrl','Јаслице:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_39c52e_00b036','sr','od 7:00 do 12:00 – uključuje doručak i užinu, uz osnovni vaspitno–obrazovni rad.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_39c52e_00b036','sr-Cyrl','од 7:00 до 12:00 – укључује доручак и ужину, уз основни васпитно–образовни рад.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_3ded8b_01b7c1','sr','Napomena: Ako preuzimanje ne počne automatski, kliknite desni taster miša na dugme i izaberite \"Sačuvaj link kao...\".','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_3ded8b_01b7c1','sr-Cyrl','Напомена: Ако преузимање не почне аутоматски, кликните десни тастер миша на дугме и изаберите \"Сачувај линк као...\".','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_54d6fe_0261fa','sr','Cena boravka obuhvata sve osnovne aktivnosti i materijal za rad, dok se dodatni programi (poput jezika, sportskih sekcija i muzičkih radionica) \n        naplaćuju po simboličnim iznosima. Naš cilj je da svako dete ima mogućnost da uči i raste u podsticajnom i bezbednom okruženju.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_54d6fe_0261fa','sr-Cyrl','Цена боравка обухвата све основне активности и материјал за рад, док се додатни програми (попут језика, спортских секција и музичких радионица) \n        наплаћују по симболичним износима. Наш циљ је да свако дете има могућност да учи и расте у подстицајном и безбедном окружењу.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_59eea1_edb984','sr','engleski jezik, ritmika, kreativne radionice, sportske sekcije i logoped.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_59eea1_edb984','sr-Cyrl','енглески језик, ритмика, креативне радионице, спортске секције и логопед.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_5b741f_538b57','sr','Dodatne aktivnosti:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_5b741f_538b57','sr-Cyrl','Додатне активности:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_6ec3c2_38a52e','sr','od 7:00 do 17:00 – uključuje tri obroka i sve aktivnosti u toku dana.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_6ec3c2_38a52e','sr-Cyrl','од 7:00 до 17:00 – укључује три оброка и све активности у току дана.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_8086f3_b75a4f','sr','Preuzmi PDF cenovnik','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_8086f3_b75a4f','sr-Cyrl','Преузми ПДФ ценовник','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_9c36a8_08a1e6','sr','Kontaktirajte nas za više informacija','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_9c36a8_08a1e6','sr-Cyrl','Контактирајте нас за више информација','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_c215aa_70c2e9','sr','Poludnevni program:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_c215aa_70c2e9','sr-Cyrl','Полудневни програм:','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_f80514_691d33','sr','poseban program prilagođen deci od 1 do 3 godine, sa individualnim pristupom i stručnim osobljem.','2025-11-14 14:38:17','2025-11-14 14:40:03'),('t_cenovnik_f80514_691d33','sr-Cyrl','посебан програм прилагођен деци од 1 до 3 године, са индивидуалним приступом и стручним особљем.','2025-11-14 14